import React from "react";

const Country = (
    {
      name,
      flags,
      officialName,
      capital,
      independent,
      population,
      continents,
      region,
      subregion
    }
  ) => {
  return(
    <div className="rounded-3xl m-auto w-60 mt-5 bg-white">
      <img alt="Country Flag" width="100px" src={flags.flags.svg ? flags.flags.svg : "https://www.publicdomainpictures.net/pictures/280000/velka/not-found-image-15383864787lu.jpg"}/>

      <div>
      <h1>{name.name.common}</h1>
      <p>Official name: {officialName.name.official ? officialName.name.official : ""}</p>
      <p>
        Capital: {capital.capital ? capital.capital.map(cap => cap) : ""}
      </p>

      <p>Independent: {independent.independent ? "YES" : "NO"}</p> 
      <p>Population: {population.population ? population.population : ""}</p>
      <p>Continent: {continents.continents ? continents.continents : ""}</p>
      <p>Region: {region.region ? region.region : ""}</p>
      <p>Subregion: {subregion.subregion ? subregion.subregion : ""}</p>

      </div>
    </div>
  )
}

export default Country
